                        if ($items[$i]->Mode == 1) {
                            $this->GroupSex1->SetValue($items[$i]->GroupSex1);
                            $this->GroupSex1->Attributes->RestoreFromArray($items[$i]->_GroupSex1Attributes);
                            $this->CountGroupSex->SetValue($items[$i]->CountGroupSex);
