    function clsNewBorn31DataSource(& $Parent)
    {
        $this->Parent = & $Parent;
        $this->ErrorBlock = "Report NewBorn31";
        $this->Initialize();
        $this->GroupSex2 = new clsField("GroupSex2", ccsInteger, "");
        
        $this->CountGroupSex = new clsField("CountGroupSex", ccsText, "");
        

    }
