            if (!$is_next_record || $SexKey != $this->DataSource->f("Sex")) {
                $Groups->CloseGroup("Sex");
            }
        }
        if (!count($Groups->Groups)) 
            $Groups->OpenGroup("Report");
        else
            $this->NoRecords->Visible = false;
        $Groups->CloseGroup("Report");
        $this->TotalPages = $Groups->TotalPages;
