class clsNewBorn35DataSource extends clsDBregistry_db {  //NewBorn35DataSource Class @511-97DCCFCF

//DataSource Variables @511-F5055419
    public $Parent = "";
    public $CCSEvents = "";
    public $CCSEventResult;
    public $ErrorBlock;
